package au.com.apathak.hackathon.optus;

public class SubstringPattern {

  public static void main(String[] args) throws  Exception {

    System.out.println(new SubstringPattern().substring("aaa"));
    System.out.println(new SubstringPattern().substring("a"));
    System.out.println(new SubstringPattern().substring(""));
    System.out.println(new SubstringPattern().substring("bbb"));
    System.out.println(new SubstringPattern().substring("testtesttest"));
    System.out.println(new SubstringPattern().substring("abcabcabc"));
    System.out.println(new SubstringPattern().substring(""));
  }

  public int substring(String X) {

    int sum = 0;
    int length = X.length();

    if (length < 3)
      return sum;
    int counter = 1;

    int start = X.length();
    while ((counter * 2) + 1 <= length) {

      //      counter++;

      start = length - counter * 2;
      //WYY
//      System.out.println(X.substring(start, start + counter) + " = " + X.substring(start + counter));
      if (X.substring(start, start + counter).equals(X.substring(start + counter))) {
        sum++;
      }
      //YWY
//      System.out.println(X.substring(0,counter) + " = " + X.substring(length-counter));
      if (X.substring(0, counter).equals(X.substring(length - counter))) {
        sum++;
      }

      //YYW
//      System.out.println(X.substring(0,counter) + " = " + X.substring(counter,counter+counter));
      if (X.substring(0, counter).equals(X.substring(counter, counter + counter))) {
        sum++;
      }
      counter++;

    }

    return sum;

  }


}
